INSERT INTO `cuestionario` VALUES (1,'¿Realizas ejercicio físico de forma regular? En caso afirmativo, describe el tipo de ejercicio y la frecuencia.\n','¿Tienes alguna enfermedad crónica?\n','¿Está tomando actualmente algún medicamento? En caso afirmativo, menciona los nombres y las dosis.\n','¿Has tenido alguna cirugía en el pasado? En caso afirmativo, describe la cirugía y la fecha.','¿Algún miembro de tu familia tiene alguna enfermedad genética o hereditaria?\n','¿Alguien en tu familia ha sido diagnosticado con cáncer, diabetes, enfermedades cardíacas u otras enfermedades crónicas?\n','¿Estás al día con tus vacunas? En caso negativo, especifica cuáles te faltan\n','¿Has recibido la vacuna contra COVID-19? En caso afirmativo, menciona la fecha y el tipo de vacuna.\n','¿Fumas actualmente? En caso afirmativo, ¿cuántos cigarrillos al día?\n','¿Consumes alcohol regularmente? En caso afirmativo, menciona la cantidad y la frecuencia.\n','¿Realizas ejercicio físico de forma regular? En caso afirmativo, describe el tipo de ejercicio y la frecuencia.\n'),(2,'¿Tiene usted antecedentes de enfermedades cardíacas?','¿Ha sufrido usted un infarto de miocardio previo?','¿Ha sido diagnosticado con hipertensión arterial?','¿Ha sido diagnosticado con diabetes?','¿Algún miembro de su familia ha tenido enfermedades cardíacas?','¿Algún miembro de su familia ha sufrido un infarto de miocardio?','¿Ha recibido la vacuna contra la gripe?','¿Ha recibido la vacuna contra la fiebre amarilla?','¿Realiza ejercicio físico regularmente?','¿Sigue una dieta saludable y equilibrada?','¿Fuma usted?'),(3,'¿Has sufrido alguna lesión o fractura ósea en el pasado? Si es así, por favor describe brevemente la lesión.','¿Has sido diagnosticado previamente con alguna enfermedad o condición médica relacionada con los huesos o las articulaciones? Si es así, por favor especifica.','¿Has tenido alguna cirugía ortopédica en el pasado? Si es así, por favor describe brevemente la cirugía.','¿Tomas algún medicamento de forma regular? En caso afirmativo, indica el nombre y la dosis del medicamento.','¿Alguno de tus familiares cercanos ha sido diagnosticado con alguna enfermedad o condición médica relacionada con los huesos o las articulaciones? Si es así, por favor especifica el grado de parentesco y la enfermedad.','¿Alguna vez has tenido alguna reacción alérgica a alguna vacuna? Si es así, por favor describe la reacción.','¿Has completado todas las vacunas recomendadas según tu edad y país de residencia? En caso negativo, indica cuáles te faltan.','¿Realizas ejercicio físico regularmente? Si es así, describe qué tipo de ejercicio y con qué frecuencia.','¿Tienes algún hábito que pueda afectar negativamente tus huesos o articulaciones, como fumar, beber alcohol en exceso o llevar una dieta poco saludable? Si es así, por favor especifica.','¿Has experimentado dolor crónico en alguna parte de tu cuerpo, especialmente en las articulaciones? Si es así, describe la ubicación y la intensidad del dolor.','¿Realizas ejercicio físico de forma regular? En caso afirmativo, describe el tipo de ejercicio y la frecuencia.'),(4,'¿Has sido diagnosticado/a con alguna enfermedad cardiovascular, como enfermedad coronaria, insuficiencia cardíaca o arritmias?','¿Has sido sometido/a a alguna cirugía cardiovascular previa, como una angioplastia coronaria o un reemplazo valvular?','¿Has experimentado síntomas de enfermedad arterial periférica, como dolor en las piernas al caminar o úlceras en los pies?','¿Padeces de hipertensión arterial o has sido diagnosticado/a con presión arterial alta?','¿Alguno de tus familiares cercanos ha sido diagnosticado con enfermedad cardiovascular, como infarto de miocardio o accidente cerebrovascular?','¿Hay antecedentes familiares de defectos cardíacos congénitos?','¿Has recibido la vacuna contra la gripe (influenza) anualmente?','¿Has sido vacunado/a contra la neumonía?','¿Eres fumador/a o has fumado en el pasado?','¿Tienes un estilo de vida sedentario o realizas actividad física regularmente?','¿Sigues una dieta saludable y equilibrada, baja en grasas saturadas y sodio?'),(5,'¿Ha tenido alguna vez problemas de coagulación de la sangre?','¿Ha sido diagnosticado con anemia o deficiencia de hierro?','¿Ha experimentado alguna vez problemas hepáticos o de función renal?','¿Ha sido diagnosticado con alguna enfermedad autoinmune?','¿Hay antecedentes familiares de enfermedades hematológicas o trastornos de la coagulación?','¿Alguno de sus familiares cercanos ha sido diagnosticado con enfermedades hepáticas o renales?','¿Ha recibido la vacuna contra la hepatitis B alguna vez?','¿Ha sido vacunado contra la influenza en los últimos 12 meses?','¿Toma regularmente algún medicamento que pueda afectar los resultados de laboratorio?','¿Ha seguido las instrucciones de ayuno adecuado antes de realizarse pruebas de laboratorio?','¿Realizas ejercicio físico de forma regular?'),(6,'¿Has tenido alguna vez fracturas óseas o lesiones en el sistema musculoesquelético?',' ¿Has sido diagnosticado/a con enfermedades respiratorias crónicas, como asma o enfermedad pulmonar obstructiva crónica (EPOC)?',' ¿Has tenido alguna vez problemas cardíacos o enfermedades cardiovasculares?','¿Has sido sometido/a a cirugías previas que involucraron el sistema musculoesquelético o el área que se va a examinar con los Rayos X?','¿Hay antecedentes familiares de enfermedades óseas, como osteoporosis o enfermedad de Paget?','¿Alguno de tus familiares cercanos ha sido diagnosticado con cáncer de huesos?','¿Has recibido la vacuna contra la tuberculosis (BCG) alguna vez?','¿Has sido vacunado/a contra la neumonía en los últimos 5 años?','¿Tienes alguna alergia conocida a medicamentos o materiales utilizados en radiología?','¿Estás embarazada o crees que podrías estarlo en la actualidad?','¿Has tenido exposición previa a altos niveles de radiación, ya sea por razones ocupacionales o médicas?'),(7,' ¿Has tenido alguna vez enfermedades del sistema digestivo, como apendicitis o enfermedad inflamatoria intestinal?','¿Te han diagnosticado alguna vez enfermedades del sistema urinario, como infecciones urinarias o cálculos renales?','¿Has tenido problemas ginecológicos, como quistes ováricos o fibromas uterinos?','¿Has tenido problemas ginecológicos, como quistes ováricos o fibromas uterinos?','¿Alguno de tus familiares cercanos ha sido diagnosticado con enfermedades del sistema cardiovascular, como enfermedad cardíaca o hipertensión?','¿Hay antecedentes familiares de enfermedades renales, como insuficiencia renal crónica?','¿Has recibido la vacuna contra la hepatitis B alguna vez?','¿Has sido vacunado/a contra la rubéola en los últimos 10 años?','¿Tienes alguna alergia conocida a medicamentos o sustancias utilizadas durante las ecografías?','¿Estás embarazada o crees que podrías estarlo en la actualidad?','¿Has tenido exposición previa a radiaciones ionizantes en cantidades significativas?'),(8,'¿Has tenido alguna vez infecciones del tracto urinario?','¿Te han diagnosticado alguna vez enfermedades de transmisión sexual, como clamidia o herpes genital?','¿Has experimentado sangrado vaginal anormal, como períodos menstruales irregulares o sangrado entre períodos?','¿Has sido diagnosticada con enfermedades ginecológicas, como endometriosis o miomas uterinos?','¿Alguno de tus familiares cercanos ha sido diagnosticado con cáncer de mama u ovario?','¿Hay antecedentes familiares de trastornos ginecológicos, como síndrome de ovario poliquístico o fibromas uterinos?','¿Has recibido la vacuna contra el virus del papiloma humano (VPH)?','¿Has sido vacunada contra la hepatitis B?','¿Has experimentado cambios en tus patrones menstruales o síntomas menstruales intensos, como dolor abdominal intenso o sangrado abundante?','¿Tienes alguna alergia conocida a medicamentos utilizados en ginecología, como anticonceptivos hormonales o lubricantes?','¿Estás tomando algún método anticonceptivo actualmente?'),(9,'¿Has tenido alguna infección del tracto urinario en el pasado?','¿Has experimentado cálculos renales o piedras en el riñón?','¿Has sido diagnosticado/a con alguna enfermedad renal, como la enfermedad renal crónica?','¿Tienes antecedentes de enfermedades de transmisión sexual que puedan afectar el tracto urinario, como la gonorrea o la clamidia?','¿Alguno de tus familiares cercanos ha sido diagnosticado con enfermedades urológicas, como cáncer de próstata o enfermedad renal poliquística?','¿Hay antecedentes familiares de trastornos genéticos relacionados con el tracto urinario, como la enfermedad de von Hippel-Lindau?','¿Has sido vacunado/a contra el virus del papiloma humano (VPH)?','¿Has recibido la vacuna contra la hepatitis B?','¿Has recibido la vacuna contra la hepatitis B?','¿Consumes regularmente alimentos ricos en sodio que podrían afectar la salud renal?','¿Tienes una dieta equilibrada que incluye frutas y verduras para promover la salud del tracto urinario?'),(10,'¿Has sido diagnosticado/a con alguna enfermedad crónica, como diabetes, hipertensión o enfermedades cardíacas?','¿Has tenido problemas de tiroides, como hipotiroidismo o hipertiroidismo?','¿Has sido diagnosticado/a con alguna enfermedad autoinmune, como artritis reumatoide o lupus?','¿Has tenido problemas gastrointestinales, como enfermedad inflamatoria intestinal o úlceras estomacales?','¿Alguno de tus familiares cercanos ha sido diagnosticado con enfermedades crónicas, como diabetes o enfermedades cardíacas?','¿Hay antecedentes familiares de enfermedades genéticas, como la enfermedad de Huntington o la hemofilia?','¿Has recibido la vacuna contra la gripe anualmente?','¿Has sido vacunado/a contra la neumonía?','¿Realizas actividad física regularmente?','¿Sigues una dieta equilibrada y saludable?','¿Tienes hábitos de sueño adecuados y descansas lo suficiente?'),(11,'¿Has sido diagnosticado/a con enfermedades respiratorias crónicas, como asma, enfermedad pulmonar obstructiva crónica (EPOC) o fibrosis pulmonar?','¿Has tenido neumonías u otras infecciones respiratorias graves en el pasado?','¿Has sido diagnosticado/a con apnea del sueño u otros trastornos respiratorios del sueño?','¿Has tenido exposición laboral o ambiental a sustancias irritantes o tóxicas para los pulmones, como humo, polvo o productos químicos?','¿Alguno de tus familiares cercanos ha sido diagnosticado con enfermedades respiratorias, como asma o EPOC?','¿Hay antecedentes familiares de enfermedades pulmonares hereditarias, como fibrosis quística?','¿Has recibido la vacuna contra la gripe anualmente?','¿Has sido vacunado/a contra la neumonía, especialmente la vacuna antineumocócica?','¿Eres fumador/a o has tenido antecedentes de tabaquismo?','¿Has tenido exposición pasiva al humo del tabaco en tu entorno?','¿Tienes antecedentes de exposición a sustancias nocivas para los pulmones, como humo de leña o gases tóxicos?'),(12,'¿Ha tenido el niño alguna enfermedad crónica o condición médica importante?','¿Ha tenido el niño hospitalizaciones o cirugías previas?','¿Ha tenido el niño alergias conocidas, como alergias alimentarias o alergias respiratorias?','¿Ha tenido el niño problemas de crecimiento o desarrollo?','¿Hay antecedentes familiares de enfermedades genéticas o hereditarias?','¿Alguno de los familiares cercanos del niño tiene enfermedades crónicas, como diabetes o hipertensión?','¿El niño ha recibido todas las vacunas recomendadas para su edad?','¿Ha tenido el niño alguna reacción adversa a alguna vacuna previa?','¿Cuál es la dieta habitual del niño? ¿Consume una variedad adecuada de alimentos?','¿Cuántas horas de sueño tiene el niño por noche?','¿Realiza el niño actividad física regularmente?'),(13,'¿El paciente ha sido diagnosticado previamente con alguna enfermedad neurológica?','¿Ha tenido el paciente convulsiones o episodios de pérdida de conciencia?','¿Ha sufrido el paciente algún traumatismo craneal significativo en el pasado?','¿Ha experimentado el paciente cambios en el estado de ánimo o trastornos del sueño?','¿Hay antecedentes familiares de enfermedades neurológicas, como enfermedad de Parkinson o enfermedad de Alzheimer?','¿Alguno de los familiares cercanos del paciente ha tenido convulsiones o trastornos neurológicos?','¿El paciente ha recibido todas las vacunas recomendadas para su edad, incluyendo las vacunas contra enfermedades como la meningitis o la encefalitis?','¿Ha tenido el paciente alguna reacción adversa a alguna vacuna previa?','¿Cuántas horas duerme el paciente por noche? ¿Tiene problemas de insomnio?','¿Practica el paciente alguna actividad física regularmente?','¿Tiene el paciente una dieta equilibrada y saludable?'),(14,'¿Ha sido diagnosticado el paciente previamente con alguna enfermedad gastrointestinal, como úlceras, enfermedad inflamatoria intestinal o enfermedad del hígado?','¿Ha experimentado el paciente síntomas de reflujo ácido, acidez estomacal o indigestión de forma recurrente?','¿Ha tenido el paciente problemas de estreñimiento o diarrea crónica?','¿Ha experimentado el paciente sangrado rectal o cambios en los hábitos intestinales?','¿Hay antecedentes familiares de enfermedades gastrointestinales, como cáncer de colon o enfermedad celíaca?','¿Alguno de los familiares cercanos del paciente ha tenido problemas de digestión o trastornos intestinales?','¿El paciente ha recibido la vacuna contra el virus de la hepatitis B?','¿Ha recibido el paciente la vacuna contra el virus del papiloma humano (VPH), que puede estar asociado a ciertos cánceres gastrointestinales?','¿El paciente consume alcohol de forma regular? En caso afirmativo, ¿cuántas bebidas alcohólicas consume por semana?','¿Fuma el paciente? En caso afirmativo, ¿cuántos cigarrillos al día?','¿Tiene el paciente una dieta equilibrada y saludable, rica en fibra y baja en grasas saturadas?'),(15,'¿Ha sido diagnosticado el paciente previamente con alguna enfermedad endocrina, como diabetes, hipotiroidismo o hipertiroidismo?','¿Ha experimentado el paciente síntomas de desequilibrios hormonales, como cambios en el peso, fatiga o cambios en el estado de ánimo?','¿Ha experimentado el paciente síntomas de desequilibrios hormonales, como cambios en el peso, fatiga o cambios en el estado de ánimo?','¿Ha tenido el paciente problemas de infertilidad o irregularidades menstruales en el caso de las mujeres?','¿Hay antecedentes familiares de enfermedades endocrinas, como diabetes, enfermedades tiroideas u otros trastornos hormonales?','¿Alguno de los familiares cercanos del paciente ha tenido problemas relacionados con el metabolismo, el peso o el sistema endocrino?','¿Alguno de los familiares cercanos del paciente ha tenido problemas relacionados con el metabolismo, el peso o el sistema endocrino?','¿Ha recibido el paciente la vacuna contra el virus del papiloma humano (VPH), en caso de ser apropiado para su edad y género?','¿El paciente lleva una alimentación equilibrada y saludable, rica en nutrientes y baja en azúcares refinados?','¿Realiza el paciente actividad física regularmente? En caso afirmativo, ¿cuántos días a la semana y durante cuánto tiempo?','¿Tiene el paciente un adecuado descanso y sueño reparador?'),(16,'¿Ha tenido el paciente problemas recurrentes de infecciones del oído (otitis) en el pasado?','¿Ha experimentado el paciente pérdida de audición o problemas de audición?','¿Ha tenido el paciente problemas crónicos de congestión nasal o dificultad para respirar por la nariz?','¿Ha experimentado el paciente problemas de equilibrio o mareos frecuentes?','¿Hay antecedentes familiares de problemas de audición o enfermedades relacionadas con los oídos, la nariz o la garganta?','¿Alguno de los familiares cercanos del paciente ha tenido cirugía o tratamiento en otorrinolaringología?','¿El paciente ha recibido la vacuna contra la influenza (gripe)?','¿Ha recibido el paciente la vacuna contra el virus del papiloma humano (VPH) en caso de ser apropiado para su edad y género?','¿El paciente se expone regularmente a ambientes ruidosos o utiliza protectores auditivos adecuados?','¿El paciente se expone regularmente a ambientes ruidosos o utiliza protectores auditivos adecuados?','¿Realiza el paciente limpieza adecuada de sus oídos y nariz para prevenir infecciones?'),(17,'¿Ha tenido el paciente problemas renales en el pasado, como infecciones del tracto urinario, cálculos renales o enfermedades renales crónicas?','¿Ha experimentado el paciente cambios en la frecuencia o color de la micción (orina)?','¿Ha tenido el paciente presión arterial alta (hipertensión) o problemas cardíacos relacionados?','¿Ha tenido el paciente diabetes u otros trastornos metabólicos?','¿Hay antecedentes familiares de enfermedades renales, como insuficiencia renal crónica o enfermedad poliquística renal?','¿Alguno de los familiares cercanos del paciente ha tenido problemas de hipertensión o enfermedades metabólicas relacionadas?','¿Ha recibido el paciente la vacuna contra la hepatitis B?','¿Ha recibido el paciente la vacuna contra la gripe (influenza)?','¿El paciente consume una cantidad adecuada de líquidos diariamente?','¿Realiza el paciente ejercicio físico regularmente?','¿Tiene el paciente una alimentación equilibrada y baja en sal?'),(18,'¿Ha tenido el paciente alguna enfermedad de la piel en el pasado, como eczema, psoriasis o dermatitis?','¿Ha experimentado el paciente problemas de acné o espinillas?','¿Ha experimentado el paciente problemas de acné o espinillas?','¿Ha tenido el paciente alguna reacción alérgica en la piel, como urticaria o dermatitis de contacto?','¿Hay antecedentes familiares de enfermedades de la piel, como dermatitis atópica o cáncer de piel?','¿Alguno de los familiares cercanos del paciente ha tenido problemas de acné o enfermedades cutáneas similares?','¿Ha recibido el paciente la vacuna contra el virus del papiloma humano (VPH)?','¿Ha recibido el paciente la vacuna contra la varicela?','¿El paciente utiliza protector solar regularmente y se protege adecuadamente del sol?','¿Tiene el paciente una rutina regular de cuidado de la piel, como limpieza e hidratación diaria?','¿Ha notado el paciente alguna relación entre su alimentación y la aparición de problemas cutáneos?');
